import React from 'react';

interface Props {
  data: {
    name: string;
    capital: string;
    population: number;
    latlng: [number, number];
    flag: string;
  };
}

const CountryInfo: React.FC<Props> = ({ data }) => {
  return (
    <div>
      <h1>{data.name}</h1>
      <p>Capital: {data.capital}</p>
      <p>Population: {data.population}</p>
      <p>Lat/Lng: {data.latlng.join(', ')}</p>
      <img src={data.flag} alt={`Flag of ${data.name}`} />
      {/* Add weather button and functionality here */}
    </div>
  );
};

export default CountryInfo;
